import Api from "../../services/api";
import  { Component } from 'react';
import { Link } from 'react-router-dom'

export default class Home extends Component {

    state = {};

     componentDidMount(){
        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
        }
        
    }
    Api.get('showProfile',config).then(
        res =>{
            this.setState({
                userDoctor:res.data
            })
        },
        err =>{
            console.log(">>>>>erro home>>>>>>>>>>>",err);
        }
    )
    };

    signUp(){
        localStorage.clear();
        window.location.href='/'
    }
    
    render() {

        if(this.state.userDoctor){
            return(
               
          
   
                <div>
                    style={{
            padding: "10px",
            width: "40%",
            background: "#f0f0f0"
          }}
                <h1>Olá <h2>{this.state.userDoctor.name}</h2></h1>
                <h2>Opções: </h2>
                <button type="button" class="btn btn-success" onClick={this.signUp} >Sair</button>
        
                
                <a  href="/viewProfile">Mozilla</a>
               
                </div>
                            
            )
        }
        return (
            <div>
             <h2>No logado</h2>
              
            </div>
            
        )
    }
}
